import React from 'react';

function Jmcoffee() {
	return (
		<div className="page">
			<h1>JM Coffee</h1>
			<div className="content">
				<h2>프로젝트 소개</h2>
				<p>JM Coffee는 커피 전문점 브랜딩 프로젝트입니다.</p>

				<h3>주요 작업 내용</h3>
				<ul>
					<li>브랜드 아이덴티티 디자인</li>
					<li>로고 및 CI/VI 시스템 구축</li>
					<li>패키지 디자인</li>
					<li>웹사이트 디자인</li>
				</ul>

				<h3>사용 기술</h3>
				<p>Adobe Illustrator, Photoshop, Figma</p>
			</div>
		</div>
	);
}

export default Jmcoffee;
